create table FOOD_AND_SUPPLY_ALLOCATION (
	FS_ID VARCHAR(5),
	Shelter_ID VARCHAR(5),
	Receive_Date DATE,
	Send_Date DATE,
	Sent_Quantity INT,
PRIMARY KEY(FS_ID, Shelter_ID, Receive_Date),
FOREIGN KEY (FS_ID) REFERENCES Food_and_Supply(FS_ID),
FOREIGN KEY (Shelter_ID) REFERENCES Shelter(Shelter_ID)
);

COLUMN Receive_Date FORMAT A12 HEADING 'Receive Date' ;
COLUMN Send_Date HEADING 'Send Date';
COLUMN Sent_Quantity HEADING 'Sent Quantity';

